function randomName() {
  const names = ["George", "Rosa", "Alexander", "Amelia", "Winston", "Cleopatra", "Abraham", "Marilyn", "Nelson", "Leonardo", "Joan", "Albert", "Marie", "Martin", "Elizabeth", "Thomas", "Florence", "William", "Mahatma", "Genghis"];
  return names[Math.floor(Math.random() * names.length)];
}
export default randomName;
